import pickle as pkl
import streamlit as st
import pandas as pd


st.title('household_power_consumption')
st.image('data:image/jpeg;base64,', width=1000)
st.header(' Measurements of electric power consumption in one household with a one-minute  Different electrical quantities and some sub-metering values ')


Global_reactive_power=st.slider("Global_reactive_power", 0, 2)
Voltage=st.slider("Voltage", 220, 255)
Global_intensity=st.slider("Global_intensity", 0, 50)
Sub_metering_1=st.slider("Sub_metering_1", 0, 100)
Sub_metering_2=st.slider("Sub_metering_2", 0, 100)
Sub_metering_3=st.slider("Sub_metering_3", 0, 100)

# Convert inputs to DataFrame
df_new = pd.DataFrame({'Global_reactive_power': [Global_reactive_power],'Voltage': [Voltage],'Global_intensity':[Global_intensity],'Sub_metering_1': [Sub_metering_1],'Sub_metering_2': [Sub_metering_2],'Sub_metering_3': [Sub_metering_3]})


# Apply the transformer on the inputs
X_new = pd.DataFrame(df_new)

# Load the model
model = pkl.load(open('model.pkl', 'rb'))


#predict model

model.predict(X_new)


